Slurm

```json
{
  "application": "Slurm",
  "details": {
    "resources": {
      "cpus": 4,
      "gpu": 1,
      "memory": "5000 MB per cpu",
      "walltime": "7 days"
    },
    "environment": {
      "export": "ALL",
      "job_name": "STREAM_INFERENCE_ROC_RESNET_50",
      "output": "logging/roc_resnet_50_%a.log",
      "requeue": true,
      "parsable": true
    },
    "script": {
      "language": "Bash",
      "commands": [
        "python -u diagnose-ratio.py --model $model_query --experiment $SLURM_ARRAY_TASK_ID --out $out"
      ]
    }
  }
}
```
